import React from "react";
import IChat from "../alias/IChat";
import ChatMessagePhoto from "./ChatMessagePhoto";

interface IProps {
  activeChat: IChat;
}

const ChatMessageIsTyping: React.FC<IProps> = ({ activeChat }) => {
  if (!activeChat.isTyping) {
    return null;
  }

  return (
    <li className={""}>
      <div className="conversation-list">
        <div className="chat-avatar">
          <ChatMessagePhoto message={activeChat.messages[0]} />
        </div>

        <div className={"user-chat-content message-chat-right"}>
          <div className="ctext-wrap">
            <div className="ctext-wrap-content">
              <p className="mb-0">
                typing
                <span className="animate-typing">
                  <span className="dot ml-1"></span>
                  <span className="dot ml-1"></span>
                  <span className="dot ml-1"></span>
                </span>
              </p>
            </div>
          </div>
          <div className="conversation-name">{activeChat.name}</div>
        </div>
      </div>
    </li>
  );
};

export default ChatMessageIsTyping;
